INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36116', '1', '54394', 'Limite máximo da variabilidade percentual (desvio padrão / média) para que a SPU tenha sua variabilidade classificada como alta. SPUs com variabilidade percentual superior a este limite são classificadas com variabilidade muito alta.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36117', '1', '54387', 'Método de cálculo da sugestão de custo unitário das SPUs a partir dos custos unitários das suas alternativas de suprimento. Os valores possíveis são: 01 ? Ponderado, 02 ? Maior custo, 03 ? Menor custo');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36118', '1', '54391', 'Tipo de custo a ser usado no cálculo de relevância. Os valores possíveis são: 01 - Custo médio, 02 - Custo de reposição, 03 - Custo alternativo');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36119', '1', '54382', 'Unidade de tempo usada para definir a duração default do período histórico relevante.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36120', '1', '54378', 'Término default para a análise do período histórico relevante para o cálculo das estatísticas do comportamento da demanda.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36121', '1', '54380', 'Duração default para a análise do período histórico relevante para o cálculo das estatísticas do comportamento da demanda.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36122', '1', '54389', 'Tamanho do bucket padrão para o cálculo da demanda média de todas as SPUs. Esse parâmetro é utilizado no caso de uso de tamanho de buckets variáveis para as SPUs.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36123', '1', '54371', 'Intervalo máximo, em meses, entre demandas durante o histórico relevante para que a SPU seja considerada muito repetitiva para SPUs de buckets mensais.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36124', '1', '54372', 'Intervalo máximo, em meses, entre demandas durante o histórico relevante para que a SPU seja considerada repetitiva para SPUs de buckets mensais.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36125', '1', '54373', 'Intervalo máximo, em meses, entre demandas durante o histórico relevante para que a SPU seja considerada esporádica para SPUs de buckets mensais. Se houver intervalos superiores a este valor a SPU é considerada muito esporádica.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36126', '1', '54376', 'Início default para a análise do período histórico relevante para o cálculo das estatísticas do comportamento da demanda.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36127', '1', '54351', 'Indicador lógico para a avaliação de previsibilidade para as SPUs de relevância de desvio padrão valorizado B. A avaliação de previsibilidade sempre é feita para as SPUs de relevância de desvio padrão valorizado A, desde que haja número suficiente de amostras de erro de previsão. A avaliação de previsibilidade nunca é feita para as SPUs de relevância de desvio padrão valorizado C. A consideração ou não das SPUs com relevância de desvio padrão valorizado B depende deste parâmetro.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36128', '1', '54363', 'Intervalo máximo, em dias, entre demandas durante o histórico relevante para que a SPU seja considerada muito repetitiva para SPUs de buckets diários.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36129', '1', '54364', 'Intervalo máximo, em dias, entre demandas durante o histórico relevante para que a SPU seja considerada repetitiva para SPUs de buckets diários.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36130', '1', '54365', 'Intervalo máximo, em dias, entre demandas durante o histórico relevante para que a SPU seja considerada esporádica para SPUs de buckets diários. Se houver intervalos superiores a este valor a SPU é considerada muito esporádica.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36131', '1', '54367', 'Intervalo máximo, em semanas, entre demandas durante o histórico relevante para que a SPU seja considerada muito repetitiva para SPUs de buckets semanais.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36132', '1', '54368', 'Intervalo máximo, em semanas, entre demandas durante o histórico relevante para que a SPU seja considerada repetitiva para SPUs de buckets semanais.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36133', '1', '54369', 'Intervalo máximo, em semanas, entre demandas durante o histórico relevante para que a SPU seja considerada esporádica para SPUs de buckets semanais. Se houver intervalos superiores a este valor a SPU é considerada muito esporádica.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36134', '1', '54358', 'Frequência mínima para que a SPU seja considerada muito repetitiva.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36135', '1', '54359', 'Frequência mínima para que a SPU seja considerada repetitiva.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36136', '1', '54360', 'Frequência mínima para que a SPU seja considerada esporádica. Abaixo deste valor a SPU é considerada muito esporádica.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36137', '1', '54347', 'Parâmetro para indicar se o sistema deve automaticamente corrigir os outliers inferiores.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36138', '1', '54349', 'Limite inferior a ser estabelecido, se a limitação automática estiver habilitada, para os pontos identificados como outliers superiores. É dado em múltiplos de IQR ? Interquartile Range, ou IQD - Distância Interquartil. Valor típico 1,50. Demandas menores que o limite inferior são consideradas nulas para efeito das estatísticas de demanda.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36139', '1', '54333', 'Origem da demanda dependente usada na análise. Se o uso de estimativas estiver habilitado, a origem pode ser a demanda histórica, a demanda estimada ou a maior das duas. Se o uso de estimativas não estiver habilitado a origem será a demanda histórica. Se o uso da demanda histórica não estiver habilitada, a origem será a estimativa.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36140', '1', '54345', 'Limite superior a ser estabelecido, se a limitação automática estiver habilitada, para os pontos identificados como outliers superiores. É dado em múltiplos de IQR ? Interquartile Range, ou IQD - Distância Interquartil. Valor típico 1,50.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36141', '1', '54343', 'Parâmetro para indicar se o sistema deve automaticamente corrigir os outliers superiores.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36142', '1', '54341', 'Critério de identificação de outliers. A identificação de outliers usa o critério de IQR ? Interquartile Range, ou IQD - Distância Interquartil. Valor típico 1,50. Se o valor da demanda em um determinado bucket é superior ao limite estabelecido, então o valor é identificado como um outlier. O limite estabelecido é dado pelo valor do terceiro quartil mais a distância interquartil, multiplicada pelo fator estabelecido.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36143', '1', '54339', 'Nível de confiança para o teste de hipóteses de normalidade da demanda. Valor típico 95%.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36156', '1', '54263', 'Esta função permite que as políticas de programação e estoques de SPUs similares sejam definidas para uma SPU representante, agrupadora, que concentra a demanda das demais para efeito das análises');
