INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36332', '1', '54415', 'Valor da diferença do estoque, calculado para a gestão Push e para a gestão Pull, que justifica a adoção da filosofia de gestão Push. Espera-se que o estoque de segurança resultante da aplicação da filosofia Push seja inferior ao estoque de segurança resultante da filosofia Pull. Por outro lado, a filosofia Push exige esforço de gestão consideravelmente maior. Só se justifica esse esforço se a diferença de estoque, favorável à filosofia Push, for superior a este parâmetro. O valor estabelecido neste parâmetro é definido na primeira moeda da Unidade de Gestão.');
