INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37664', '1', '55760', 'Ordem de precedência da aplicação dos pesos e das notas de criticidade. Os pesos dos critérios de criticidade podem ser definidos para a análise como um todo e para as Unidades de Gestão. As notas podem ser definidas para os itens e para as SPUs. Os critérios de criticidade em si são definidos para a análise como um todo e não podem ser alterados nos níveis mais baixos.
Os valores possíveis são:
01 ? Precedência: particular para geral
02 ? Precedência: geral para particular
A precedência 01 ? particular para o geral significa que se pode definir uma regra geral no nível mais alto, mas se houver uma definição diferente para um nível mais baixo, vale prioritariamente o nível mais baixo. Ou seja, valem as exceções.
A precedência 02 ? geral para particular, significa que a regra geral se sobrepõe às regras de exceção. Impõe-se a regra geral sobre quaisquer exceções feitas nos níveis mais baixos.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37665', '1', '55761', 'Ordem de precedência da aplicação das notas dos fatores qualitativos. As notas podem ser definidas para os itens e para as SPUs. Os fatores qualitativos em si são definidos para a análise como um todo e não podem ser alterados nos níveis mais baixos.
Os valores possíveis são:
01 ? Precedência: particular para geral
02 ? Precedência: geral para particular.
A precedência 01 ? particular para o geral significa que se pode definir uma regra geral no nível mais alto, mas se houver uma definição diferente para um nível mais baixo, vale prioritariamente o nível mais baixo. Ou seja, valem as exceções.
A precedência 02 ? geral para particular, significa que a regra geral se sobrepõe às regras de exceção. Impõe-se a regra geral sobre quaisquer exceções feitas nos níveis mais baixos.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37666', '1', '55762', 'Parâmetro que indica a precedência da sugestão do sistema sobre o input do usuário para os custos médio, de reposição e alternativo.
